import React, { useContext } from "react";
import { Button, Disclosure } from "@headlessui/react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import AuthContext, { getCSRFToken } from "../context/auth";

const navigation = [
  { name: "Home", href: "/", current: false },
  { name: "Products", href: "/products", current: false },
  { name: "Add Product", href: "/admin/add-product", current: false },
  { name: "Admin Products", href: "/admin/products", current: false },
  {
    name: "Shopping Bag",
    href: "/shoppingBag",
    current: false,
  },
  {
    name: "Search",
    href: "/shoppingBag",
    current: false,
  },
  { name: "Orders", href: "/orders", current: false },
];

function classNames(...classes) {
  return classes.filter(Boolean).join(" ");
}

const NavBar = () => {
  const location = useLocation();
  const currentPath = location.pathname;
  const authCtx = useContext(AuthContext);
  const navigate = useNavigate();

  return (
    <Disclosure as="nav" className="bg-gray-800">
      <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="relative flex h-16 items-center justify-between">
          <div className="flex flex-1 items-center justify-center sm:items-stretch sm:justify-start">
            <div className="hidden sm:ml-6 sm:block">
              <div className="flex space-x-4 ">
                {navigation.map((item) => {
                  const activeTab = item.href === currentPath;
                  const adminItem = item.href.startsWith("/admin");

                  if (adminItem && !authCtx.user?.roleAdmin) {
                    return null;
                  }
                  if (!authCtx.user?.isLoggedIn && item.name === "Orders") {
                    return null;
                  }
                  if (
                    !adminItem &&
                    authCtx.user.roleAdmin &&
                    item.name === "Shopping Bag"
                  ) {
                    return null;
                  }
                  if (item.name === "Search") {
                    return <div><button type="button" data-collapse-toggle="navbar-search" aria-controls="navbar-search" aria-expanded="false" className="md:hidden text-gray-500 dark:text-gray-400 hover:bg-gray-100 dark:hover:bg-gray-700 focus:outline-none focus:ring-4 focus:ring-gray-200 dark:focus:ring-gray-700 rounded-lg text-sm p-2.5 me-1">
      <svg className="w-5 h-5" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 20 20">
        <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"/>
      </svg>
      <span className="sr-only">Search</span>
    </button>
    <div className="relative hidden md:block">
      <div className="absolute inset-y-0 start-0 flex items-center ps-3 pointer-events-none">
        <svg className="w-4 h-4 text-gray-500 dark:text-gray-400" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 20 20">
          <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"/>
        </svg>
        <span className="sr-only">Search icon</span>
      </div>
      <input type="text" id="search-navbar" className="block w-full p-2 ps-10 text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="Search..."/>
    </div></div>;
                  }

                  return (
                    <Link
                      key={item.name}
                      to={item.href}
                      aria-current={activeTab ? "page" : undefined}
                      className={classNames(
                        activeTab
                          ? "bg-gray-900 text-white"
                          : "text-gray-300 hover:bg-gray-700 hover:text-white",
                        "rounded-md px-3 py-2 text-sm font-medium",
                        "flex justify-center"
                      )}
                    >
                      <span className="mr-2 align-bottom">{item.name}</span>
                      {item.name === "Shopping Bag" && (
                        <svg
                          xmlns="http://www.w3.org/2000/svg"
                          fill="none"
                          viewBox="0 0 24 24"
                          strokeWidth="1.5"
                          stroke="currentColor"
                          className="size-6"
                        >
                          <path
                            strokeLinecap="round"
                            strokeLinejoin="round"
                            d="M15.75 10.5V6a3.75 3.75 0 1 0-7.5 0v4.5m11.356-1.993 1.263 12c.07.665-.45 1.243-1.119 1.243H4.25a1.125 1.125 0 0 1-1.12-1.243l1.264-12A1.125 1.125 0 0 1 5.513 7.5h12.974c.576 0 1.059.435 1.119 1.007ZM8.625 10.5a.375.375 0 1 1-.75 0 .375.375 0 0 1 .75 0Zm7.5 0a.375.375 0 1 1-.75 0 .375.375 0 0 1 .75 0Z"
                          />
                        </svg>
                      )}
                    </Link>
                  );
                })}
              </div>
            </div>
            {!authCtx.user?.isLoggedIn && (
              <div className="ml-auto my-auto">
                <Link
                  to="/login"
                  className={classNames(
                    currentPath === "/login"
                      ? "bg-gray-900 text-white"
                      : "text-gray-300 hover:bg-gray-700 hover:text-white",
                    "rounded-md px-3 py-2 text-sm font-medium"
                  )}
                >
                  Login
                </Link>
              </div>
            )}
            {authCtx.user.isLoggedIn && (
              <div className="ml-auto my-auto">
                <Button
                  className={classNames(
                    "text-gray-300 hover:bg-gray-700 hover:text-white",
                    "rounded-md px-3 py-2 text-sm font-medium"
                  )}
                  onClick={async () => {
                    const csrfToken = await getCSRFToken();
                    const res = await fetch(
                      "http://localhost:5000/auth/logout",
                      {
                        method: "POST",
                        body: null,
                        credentials: "include",
                        headers: {
                          "X-CSRF-Token": csrfToken,
                        },
                      }
                    );
                    await res.json();
                    authCtx.logout();
                    navigate("/products");
                  }}
                >
                  Logout
                </Button>
              </div>
            )}
          </div>
        </div>
      </div>
    </Disclosure>
  );
};

export default NavBar;
